import logo from './logo.svg';
import './App.css';
import {Container , Stack, Flex , List , ListItem} from "@chakra-ui/react" ; 
function App() {
  return (
   <Container>
    <Flex justify= "space-between" height = "90vh" align = "cenetr">
      <Stack width = "300px">
        <List p="4" minH = "70vh" boxShadow="xl" borderRadius = "md">
          <ListItem>players</ListItem>
        </List>
      </Stack>
      <Stack width = "300px">
        <List p="4" minH = "70vh" boxShadow="xl" borderRadius = "md">
          <ListItem></ListItem>
        </List>
      </Stack>
    </Flex>
   </Container>
  );
}

export default App;
